//struct for projectile functions, struct, and physics


#include <math.h>
#include <stdint.h>
#include "../inc/tm4c123gh6pm.h"
#include "ST7735.h"
#include "player.h"


const unsigned short Mountain1[];

const unsigned short projectileImage[] = {
 0x07FB
};

const unsigned short projectileDisappear[] = {
  0xE9CB
};

void Delay(void){
	int time = 300000;
    while(time){
	  	time--;
    }
}

int abs(int x){
	if (x < 0)
		return x*-1;
	return x;
}

typedef struct{
	int x;
	int y;
	int xVel;	//ranges 0-100
	int yVel;	//ranges -100-100
	int prevX;
	int prevY;
} projectile_t;

projectile_t projectile = {5, 65, 30, 50, 5, 65};

void PrintProjectile(void){
	ST7735_DrawBitmap(projectile.y, projectile.x, projectileImage, 1, 1);
	if (projectile.x != projectile.prevX || projectile.y != projectile.prevY)
		ST7735_DrawBitmap(projectile.prevY, projectile.prevX, projectileDisappear, 1, 1);
	projectile.prevX = projectile.x;
	projectile.prevY = projectile.y;
}

void DeleteProjectile(void){
	ST7735_DrawBitmap(projectile.prevY, projectile.prevX, projectileDisappear, 1, 1);
}


void ProjectileSetVel(int xVel, int yVel){
	projectile.xVel = xVel;
	projectile.yVel = yVel;
}

void ProjectileSetPos(int x, int y){
	projectile.x = x;
	projectile.y = y;
}

int Player1Fire(int power, int angle){
	ProjectileSetPos(Tank1GetPos(), 70);
	int x0 = projectile.x;
	int y0 = projectile.y;
	projectile.xVel = power*cos(angle*3.14/180);
	projectile.yVel = power*sin(angle*3.14/180);
	double time = 0;
	int g = 10;
	
	while ((Mountain1[projectile.x*128+projectile.y]==0xE9CB || projectile.y >=127) && projectile.x > 0 && projectile.x < 160){
		projectile.x = x0 + projectile.xVel*time;
		projectile.y = y0 + projectile.yVel*time - (g*time*time)/2;
		time = time + 0.05;
		if (Mountain1[projectile.x*128+projectile.y]==0xE9CB || projectile.y >=127)
			PrintProjectile();
		Delay();
	}
	DeleteProjectile();
	int tankpos = Tank2GetPos();
	if (projectile.x >= (tankpos-9) && projectile.x < tankpos)
		return 1;
	return 0;
}

int Player2Fire(int power, int angle){
	ProjectileSetPos(Tank2GetPos()-9, 70);
	int x0 = projectile.x;
	int y0 = projectile.y;
	projectile.xVel = (-1)*power*cos(angle*3.14/180);
	projectile.yVel = power*sin(angle*3.14/180);
	double time = 0;
	int g = 10;
	
	while ((Mountain1[projectile.x*128+projectile.y]==0xE9CB || projectile.y >=127)&& projectile.x > 0 && projectile.x < 160){
		projectile.x = x0 + projectile.xVel*time;
		projectile.y = y0 + projectile.yVel*time - (g*time*time)/2;
		time = time + 0.05;
		if (Mountain1[projectile.x*128+projectile.y]==0xE9CB || projectile.y >=127)
			PrintProjectile();
		Delay();
	}
	DeleteProjectile();
	int tankpos = Tank1GetPos();
	if (projectile.x <= tankpos && projectile.x > (tankpos-9))
		return 1;
	return 0;
}




